import React from "react";

const Project = () => {
  return (
    <div className="my-5">
      <h1 className="tab-center"> My Projects</h1>

      <div className="container-fluid ">
        <div className="row">
          <div className="col-10 mx-auto"></div>
        </div>
      </div>
    </div>
  );
};

export default Project;
